import React from 'react';

const Product = (props) => {
    console.log(props.product.name)
    const {img,name} = props.product
    return (
        <div className="product">

            <div>
                <img src={img} alt="" />
            </div>
            

            <div>
                <h1>This is Product: </h1>
                <h3>{name}</h3>
            </div>

        </div>
    );
};

export default Product;
